import React, {Component, useState} from 'react';
import ReactDOM from 'react-dom';
import './navbar.css';
import myFirebase from "../../firebase.js";
import SignIn from '../signup/Signin.js';

const Navbar = (props) => {
  const [signedIn,signIn] = useState(false);


  return(
    <div className="navbar">
    <div className="login_form"> {signedIn? `Welcome, ${this.props.user}` : "Please Sign In"} <SignIn /> </div>
    </div>
  )

};
export default Navbar;
